INSERT INTO `hjmall_fxhb_setting` VALUES ('1', '1', '2', '5.00', '5.00', '30', '0', '', '24', '1', '1.用户可邀请好友共同拆红包，满N人则拆红包现金红包成功，共同瓜分总金额为N元的红包，每人获得红包金额随机（或平均）; 其中随机一人将获得“手气最佳红包”。\r\n2.每个红包发起后24小时未组满N人即失败，无红包奖励。\r\n3.活动期间，不能帮同一好友拆多次，但发起拆红包次数不限。\r\n4.发起拆红包的用户需在该红包满N人拆成功或逾期失败后，才可再发起拆下一个红包。\r\n5.一起拆红包活动的红包均为满减现金券。\r\n6.本公司对该活动规则保留最终解释权。', '', '好友邀请你一起来拆红包');
