INSERT INTO `hjmall_topic` VALUES ('2', '1', '女生的腋毛该不该刮，看完这里你就知道了', '', 'https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/ba/ba01cd665119016686a0090d751c8979.jpg', '<p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; <span style=\"font-size: 16px;\">玉洁冰清的美丽胴体是每个女人的追求，尤其到了炎热的夏季，我们的着装都会偏清凉一些，大部分的时候四肢都没有任何包裹的裸露在外，而肌肤不论是诱人的雪白色还是健康的小麦色，都可以变成迷人的焦点。但如果这统一的颜色中重新了一点黑色，那可绝没有“万花丛中一点绿”的感觉，而是“一粒老鼠屎，糟蹋一锅汤”，我们绝不允许这样的事情发生！！</span><br/></p><p style=\"line-height: 1.75em;\"><span style=\"font-size: 16px;\"><br/></span></p><p style=\"text-align:center\"><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/a9/a9eede35b2a53aeaa04a851b8a9093a3.jpg\" title=\"\" alt=\"\"/></p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp;<span style=\"font-size: 16px;\"> &nbsp;一到夏季，很多妹纸们都有一个烦恼，到底该不该刮掉这该死的腋毛，不刮实在是有点恶心，特别是穿着吊带，背心或者无袖的衣服，那腋毛被人看的清清楚楚，感觉像个男人一样，长出那么多的腋毛，令人很反感。</span><br/></p><p style=\"line-height: 1.75em;\"><span style=\"font-size: 16px;\"><br/></span></p><p style=\"text-align:center\"><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/4c/4c873ceb6a347d6d786498a6c182789b.jpg\" title=\"\" alt=\"\"/></p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; <span style=\"font-size: 16px;\">&nbsp;但是却有的人觉得有点腋毛很性感，特别的有女人味，不应该刮掉，刮与不刮全凭你个人爱好，你觉得它影响你的视觉美观，那你还是刮掉好点，毕竟没有人会觉得露出点腋毛是时尚的潮流。<br/>&nbsp; &nbsp; &nbsp;不过刮腋毛之前要注意以下，才确定你要不要刮哦~<br/>最好不要用眉毛夹子去拨腋毛，这样容易导致毛囊发炎，引起皮肤松弛，这样得不偿失~</span><br/></p><p style=\"line-height: 1.75em;\"><span style=\"font-size: 16px;\"><br/></span></p><p style=\"text-align:center\"><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/e9/e9bf48092544cb1b36f7782ff380fbf2.jpg\" title=\"\" alt=\"\"/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp;&nbsp;</p><p style=\"line-height: 1.75em;\"><span style=\"font-size: 16px;\">&nbsp; 网上评论说腋毛拨的次数越多，长的越快，其实这个说法并不对，腋毛长的快不快，其实是由个人的基因荷尔蒙决定的，所以不需要担心拨的次数，如果不使用正确的脱毛工具，对皮肤也是一种伤害，所以一定要做一个健康的美丽女人，来看看我们为你带来比较好用的工具。<br/></span><br/><strong><span style=\"font-size: 16px;\">雷瓦女士脱毛器<br/><br/></span></strong><br/></p><div><a class=\"goods-link\" goods=\"true\" href=\"/pages/goods/goods?id=49\" style=\"display: block;background: #f3f3f3;border: 1px solid #eee;position: relative;height: 6rem;color: #333;text-decoration: none\"><img mode=\"aspectFill\" class=\"goods-img\" src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/78/7880e9e8f899c75b5da6db5278690f1d.jpg\"/><div class=\"goods-info flex-col\" style=\"padding:.5rem .5rem .5rem 6rem\"><div class=\"goods-name flex-grow-1\">雷瓦女用脱毛器剃毛器修剪器女腋毛剃毛刀女士</div><div class=\"flex-grow-0\"><strong class=\"goods-price\" style=\"color:#ff4544\">￥59.00</strong><span class=\"buy-btn\" style=\"display: inline-block;float: right;font-size: 12px;border: 1px solid #ff4544;color: #ff4544;border-radius: .15rem;padding: .25rem .5rem;\">去购买</span></div></div></a></div><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; <span style=\"font-size: 16px;\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-size: 16px;\">&nbsp;有哪个女孩子敢说自己不爱美的，谁都不希望这点小瑕疵给你带来的影响，都想做一个有魅力的女人，一款雷瓦女士脱毛器更方便快捷，更好的呵护你的每一寸肌肤，不管任何部位的毛毛都可以脱，采用了3D浮动刀网，清洁比较彻底，使用起来更加安全~</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-size: 16px;\"><br/></span><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/8d/8d32f7a77d48b4bd7078654e22133096.jpg\"/></p><p><br/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/75/75ae8ef3011a9ff03555ce85ff0e2fa8.jpg\"/><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/75/75e89cfcad1bce94fc4419f305d28568.jpg\" title=\"\" alt=\"\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/c5/c51f4a3f001ea7b3c5a44975d87a777e.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/92/9219482ee7e088f5539e4627f1f0cde7.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/81/816bb5fbad73a89533f52f5920039bec.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/fa/fa813df487f4783a8c0e59a9648699be.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/9a/9ae42d7c275142f2140031c0f502ce47.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/1b/1bc2f2c0a3ea2a55576f244ff41be355.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/ad/ad085745e305ce01a49a7ad5dc5a65d9.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/ed/ed9038cac134f092bd673ff73b2b2354.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/31/31ce1761d221e6f4516e40cbbe08adae.jpg\"/></p><p><br/></p>', '35', '300', '0', '2', '0', '0', '260', '1529380109', '0', '1', '1');
INSERT INTO `hjmall_topic` VALUES ('3', '1', '必备神器，只为打造职场型男', '', 'https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/09/093b3db60e083ed66565fa6fe99e1954.jpg', '<p style=\"line-height: 1.75em;\"><video src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/video/36/3624efac951ee5f787fa6b110d39afc4.mp4\"></video><br/><span style=\"font-size: 16px;\">胡子，头发对于广大男性朋友的重要性不用多言，适合的胡须。发型不仅能帮助你的修饰造型，还可以能让你在职场上保持精神饱满的工作状态。帅气的胡须，是帅气男士的标志，适合的发型则是成熟男性的完美配饰。</span><br/><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/3a/3ad9250dff2d1373ea17a862e1ffe0b2.jpg\" title=\"\" alt=\"\"/><br/><span style=\"font-size: 16px;\">对于脸型微椭的男士来说，比较适合在下巴处留出微密的胡须。所以可以通过剃须刀修剪自己的胡子到适合自己脸型的长度，发型则可选择背头，这样也能给人一种短直刚正的感觉，这样不仅能增加阅历感，而且还可给女士留下帅气的印象~~</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-size: 16px;\">下面我来给大家介绍一款非常实用的剃须刀~</span></p><p><strong><span style=\"font-size: 18px;\">雷瓦3D浮动试剃须刀</span></strong></p><div><a class=\"goods-link\" goods=\"true\" href=\"/pages/goods/goods?id=5\" style=\"display: block;background: #f3f3f3;border: 1px solid #eee;position: relative;height: 6rem;color: #333;text-decoration: none\"><img mode=\"aspectFill\" class=\"goods-img\" src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/09/093b3db60e083ed66565fa6fe99e1954.jpg\"/><div class=\"goods-info flex-col\" style=\"padding:.5rem .5rem .5rem 6rem\"><div class=\"goods-name flex-grow-1\">雷瓦3D立体浮动式三刀头剃须刀智能防夹须</div><div class=\"flex-grow-0\"><p><strong class=\"goods-price\" style=\"color:#ff4544\">￥79.00</strong></p><span class=\"buy-btn\" style=\"display: inline-block;float: right;font-size: 12px;border: 1px solid #ff4544;color: #ff4544;border-radius: .15rem;padding: .25rem .5rem;\">去购买</span></div></div></a></div><p style=\"line-height: 1.75em;\"><span style=\"font-size: 16px;\">黑色的机身，流行性的设计，灵动时尚，尽显男士霸气风貌。3D浮动试三刀头刀设计，可轻松捕捉长短胡须，让你获得更顺畅的剃须效果。</span><span style=\"font-size: 14px;\"><br/></span></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/26/2695bd809049d1f3b7889ae19ae96b4f.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/8d/8dd62260f78968fd6b67110fd290c1f6.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/38/38d13a3f4e2c202bdf923dc061dde32f.jpg\"/><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/59/591678dba0fccfab2751fa31301ca1cf.jpg\" title=\"\" alt=\"\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/9e/9eddad88be984e5bdbad3fd3a9314480.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/35/35599f96118c53017e2f75db4ea607a8.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/32/32e3612ec388af8b1866f5b9696454da.jpg\"/></p><p><br/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/90/9048c6e7bf99aefbbfcf09f3fbc7e534.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/15/15bb7790c14d099e9ca5f27c94e2084f.jpg\"/></p><p><img src=\"https://www.yuanchuangyc.cn/addons/zjhj_mall/core/web/uploads/image/9e/9e4863043bcb667a96b85517a81c1eab.jpg\"/></p><p><span style=\"font-size: 14px;\"><br/></span><br/></p><p><br/></p>', '17', '200', '0', '3', '0', '0', '150', '1529391209', '0', '1', '1');
